// import './App.css';
import Home from "./Components/Home/Home";
import {Routes,Route} from "react";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element = {<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
